Defendant Jorge A Licona in court with attorney Ronald James Sonderhouse.  Barbara A. Michaels appeared for the State of Wisconsin.  Defendant enters a plea of no contest to Count 2  The Defendant was given the following:

WITHHELD SENTENCE;

TERM OF PROBATION:  1 YEAR;

CONDITIONS OF PROBATION:  
*Maintain full time employment and/or combination of schooling 
*No contact with:  co-defendant, victim, or victim's residence.
*DNA sample to be provided if not yet previously done.
*Any other condition deemed appropriate by agent. 
*Perform 50 hours community service.
